import React from 'react'
import {PokemonCard} from './PokemonCard'
import './Cards.css'
export const AllCards = ({results}) =>{
    return(
        <div className = 'container'>
            <ul className = 'cards'>
                {
                    results.map(res=>
                        //console.log("Resultados del Res",res)
                        (
                        <li className = 'card-item' key={res.name}>
                            <PokemonCard url={res.results}/>
                        </li>
                        
                    ))
                }
            </ul>
        </div>
    )
}
